import eyeIcon from '../../images/eye.svg';
import React, { useState, useEffect } from 'react';
// import Header from '../Header/Header';
import AdminHeader from './AdminHeader';
import './ProductList.css';
import FileUploader from './FileUploader';
import adminApi from '../../utils/adminApi';
import productsApi from '../../utils/Api';
import { DEFAULT_COLOR_LIST, FEATURES_LIST, HARDCODED_CATEGORIES } from '../../utils/constants';

import imageIcon from '../../images/image.svg';


function ProductList({ terms }) {

    const [products, setProducts] = useState([]);

    useEffect(() => {
        productsApi.filterProducts('', '')
        .then((data) => {
          setProducts(data);
        }).catch((err) => {
          console.log(err);
        })
      
      }, []);

  const [upsellsSearchResults, setUpsellsSearchResults] = useState([]);
  const [isUpsellsSearchResultsShowing, setIsUpsellsSearchResultsShowing] = useState(false);
  const [upsellsSelected, setUpsellsSelected] = useState([]);



    return (
        <>
            <AdminHeader
            />
        <div className="productList">
        <div className="table_header">
                    <span style={{textAlign: 'center'}}><img src={imageIcon} /></span>
                    <span>Название</span>
                    <span>Артикул</span>
                    <span>Наличие</span>
                    <span>Цена</span>
                    <span>Категории</span>
                    <span>Камни</span>
                    <span>***</span>
                    <span>Статус</span>
                    <span>Редактировать</span>
                    <span>*</span>
            </div>
                {products.map(product => (
                    <div className='table_product' key={product.productId}>
                        <span>
                            <img src={"https://dolina.shop/photos/" + product.pictures[0].path.slice(0, -4) + `_preview.jpg`} alt={product.title} className='table_product_img' />
                        </span>
                        <span>{product.title}</span>
                        <span>{product.SKU}</span>
                        <span>{product.inStock}</span>
                        <span className='table_price'>{product.price} ₽</span>
                        <span className='table_categories'>
                            {product.categories.slice(0, 2).map((category, index) => (
                                <span key={category.termId}>
                                    {category.name}
                                    {index !== product.categories.slice(0, 2).length - 1 && ', '}
                                </span>
                            ))}
                        </span>
                        <span className='table_tags'>
                            {product.tags.slice(0, 3).map((tag, index) => (
                                <span key={tag.termId}>
                                    {tag.name}
                                    {index !== product.tags.slice(0, 3).length - 1 && ', '}
                                </span>
                            ))}
                        </span>
                        <span>*</span>
                        <span>{product.published ? 'Опубликовано' : 'Черновик'}</span>
                        <span><a href={'/administration/product/' + product.productId}>Изменить</a></span>
                        <span><a href={'http://backend.dolina.shop/admin/products?productId=' + product.productId}> [x]</a></span>
                    </div>
                ))}
        </div>
        </>
    )
};

export default ProductList;
